const CardTeam = (props) =>{
    return (
        <div className="single-team-box team-box-bg-1">
                <div className="team-box-inner">
                <h3>tom hanks</h3>
                <p className="team-meta">Founder &amp; CEO</p>
                <Lonk href="/#" className="learn-btn">{props.image}</Lonk>
                    learn more
                </div>
                
        </div>
    )
}
export default CardTeam;
